%[text] ## 2.4 Discrete Time Controller
%[text] In reality, measurements of the vehicle's state are only available in discrete time, and new commands can only be sent to the propellers at discrete time instants. Convert your continuous time model to a hybrid model where the non-linear dynamics of the vehicle are simulated in continuous time, the full-state measurements are taken at a particular frequency, and the controller computations are performed at a different frequency.
%[text] Note: When state estimation is not performed, these frequencies are typically the same, and for the experiments we will collect measurements at 200Hz.
%%
%[text] In Simulink, this is implemented most easily by adding "Rate Transition" or "Zero-Order Hold" blocks. Meaning to convert a continuous signal into a discretized one, add a rate transition block to the signal line.
%[text] Open the corresponding subsystem in the Simulink drone model:
load_system('exercise02_simulation_model_template_R2025b')
open_system('exercise02_simulation_model_template_R2025b/Controller','tab')
%[text] Then add 2 rate transition blocks:
%[text] - one to the sensor signal line and name it "SensorSampleRate" (note this is the signal called full state).
%[text] - one in front of the controller LQR gain matrix and name it "Controller\_Pace". \
%[text] Note: You do not have to specify the sample rates in the rate transition blocks. In comparison to the preceeding exercises we will use the app to set the Simulink block parameters using sliders and the set\_param functionality. For example, the code below contains the callback to one of the sliders.
%[text] ```matlabCodeExample
%[text]         % Value changed function: ControllerRateDropDown
%[text]         function ControllerRateDropDownValueChanged(app, event)
%[text]             try
%[text]                 switch app.ControllerRateDropDown.Value
%[text]                     case 'cont'
%[text]                         %set_param(app.name + "/Controller/ControllerPace/",'Commented','through' %-> ctrl input would have same rate as sensor sample rate
%[text]                         set_param(app.name + "/Controller/ControllerPace",'Commented','through');
%[text]                     case '20 Hz'
%[text]                         set_param(app.name + "/Controller/ControllerPace/",'OutPortSampleTime','0.05','Commented','off');
%[text]                     case '50 Hz'
%[text]                         set_param(app.name + "/Controller/ControllerPace/",'OutPortSampleTime','0.02','Commented','off');
%[text]                     case '100 Hz'
%[text]                         set_param(app.name + "/Controller/ControllerPace/",'OutPortSampleTime','0.01','Commented','off');
%[text]                     case '200 Hz'
%[text]                         set_param(app.name + "/Controller/ControllerPace/",'OutPortSampleTime','0.005','Commented','off');
%[text]                 end
%[text]             catch
%[text]                 msgbox("The rate transition blocks have not been implemented correctly.","Warning","warn")
%[text]             end  
%[text] ```
%[text] 
%[text] 
%%
%[text] Let's now investigate the influence of the controller frequency. Open the app and load the simulink model where you added the rate transistion blocks. Please note there is no need to close the model before you open the app. The app will always use the current state of the model, meaning it will include changes that you have done even if they have not been saved.
PS_Quadcopter_Lab_app; %[output:414126c9]
%[text] The sample rates of the rate transition blocks can be adjusted using the sliders in the exercise panel. For your reference:
%[text] - "Controller Gains": Denotes the frequency for which the gains in the "LQR gain" block have been derived.
%[text] - "Controller Rate": Sets the input sample rate for the LQR gain block (rate transition block). Defines the pace for the application of the LQR gains.
%[text] - "Sensors" defines the sample rate of the sensors (rate transition block). \
%%
%[text] Investigate the impact of the signal and controller frequencies.
%[text] - How is the step change tracking performance affected by the frequency of control computations?
%[text] - Does the closed loop system become unstable at some frequency? \
%[text] Test out the following two combinations:
%[text] - set the controller computations to a frequency of 20Hz, but use the controller parameters designed for 200Hz
%[text] - set the controller computations to a frequency of 200Hz, but use the controller parameters designed for 20Hz.  \
%[text] Explain the results using intuitive arguments.
